import React from 'react';
import {connect} from 'react-redux'
import {anotherName} from './actions/actions'
import './App.css';

function App(props) {
    const myWish=props.wish.map()
    return (
    <div>
    <button onClick={()=>{props.changeName()}}>change</button>
    <p>i will do this a my name is {props.name} </p>
    </div>

    );
}

const mapDispatchToProps=(dispatch)=>{
  return{
    changeName:(name)=>{dispatch(anotherName(name))}
  }
}
const mapStateToStore=(state)=>{
  return {
    name:state.name,
    wish:state.wish
  }


}
export default connect(mapStateToStore,mapDispatchToProps)(App);
